Subroutine CouplingAhAhAhAhQ(gt1,gt2,gt3,gt4,g1,g2,gBL,gYB,gBY,ZA,res1)

Implicit None 

Integer, Intent(in) :: gt1,gt2,gt3,gt4
Real(dp), Intent(in) :: g1,g2,gBL,gYB,gBY,ZA(4,4)

Complex(dp), Intent(out) :: res1 
